"""
LeetCode :: March 2022 Challenge :: 81. Search in Rotated Sorted Array II
jramaswami

xxxxx|yyyyyy
y <= x

m is nums[mid]
if m < x then m is to the right of pivot (yyyy)
if m > x then m is to the left of the pivot (xxxx)
if m == x then all x == y or ??? size is one?
"""


class Solution:
    def search(self, nums, target):
        lo = 0
        hi = len(nums) - 1
        while lo <= hi:
            mid = lo + ((hi - lo) // 2)
            a = nums[lo]
            b = nums[mid]
            c = nums[hi]
            print(f"{lo=} {mid=} {hi=} {a=} {b=} {c=}")
            if target == b:
                return True
            elif a <= target <= b:
                hi = mid - 1
            elif b <= target <= c:
                lo = mid + 1
            elif target < a:
                lo = mid + 1
            elif target > b and target > a:
                hi = mid - 1
            elif target > b and target < a:
                lo = mid + 1
        return False


def test_1():
    nums = [2,5,6,0,0,1,2]
    target = 0
    expected = True
    assert Solution().search(nums, target) == expected


def test_2():
    nums = [2,5,6,0,0,1,2]
    target = 3
    expected = False
    assert Solution().search(nums, target) == expected


def xtest_random():
    import random
    import collections
    for _ in range(100):
        N = 5000
        K = pow(10,4)
        A = collections.deque(sorted(random.randint(-K, K) for _ in range(N)))
        R = random.randint(0, N)
        A.rotate(R)
        target = random.randint(-K, K)
        expected = (target in A)
        result = Solution().search(A, target)
        if result != expected:
            print(A)
            print(target)
        assert result == expected


